eval("module.exports = JSON.parse('{\"mainPage\":{\"id\":\"mainPage\",\"fr\":{\"prez\":\"FR - Je m\\'appelle Damien Voindrot et je suis un artiste passionn par la peinture et l\\'illustration. J\\'adore crer des uvres uniques et captivantes qui, je l\\'espre, sauront charmer les gens du monde entier. J\\'aime jouer avec les couleurs et les formes pour donner vie  des paysages et des personnages qui m\\'inspirent.\",\"cta\":{\"text\":\"contactez-moi\",\"link\":\"mailto:damien.voindrot@gmail.com\"},\"nav\":{\"paintings\":\"peintures\",\"illustrations\":\"illustrations\"}},\"en\":{\"prez\":\"EN - My name is Damien Voindrot and I am an artist passionate about painting and illustration. I love creating unique and captivating works that I hope will charm people all over the world. I like to play with colors and shapes to give life to landscapes and characters that inspire me. Even though I learned a lot and gained experience, I still consider myself a constant learner.\",\"cta\":{\"text\":\"contact-me\",\"link\":\"mailto:damien.voindrot@gmail.com\"},\"nav\":{\"paintings\":\"paintings\",\"illustrations\":\"illustrations\"}}},\"paintings\":{\"id\":\"paintings\",\"fr\":{\"title\":\"Labyrinthes\",\"prez\":\"FR - Je peins des formes abstraites de labyrinthes. En les crant, c\\'est moi qui me perds dans ces labyrinthes. Trouver l\\'issue du labyrinthe signifie offrir au spectateur l\\'harmonie des formes et la dynamique des couleurs. De faons mtaphoriques,les labyrinthes sont les difficults, inutiles, rituelles, que nous mettons dans notre quotidien pour donner de la valeur  ce que nous accomplissons. Combien de temps faut-il travailler sur un sujet pour qu\\'il soit srieux ? Comment faut-il raliser ce cocktail pour qu\\'il ait le parfum du luxe ? Comment dois-je choisir mes vtements pour avoir l\\'air formel ? Toutes ces choses que l\\'on fait, nous perdant dans le repli de nos esprits, esprant donner de la valeur au chemin parcouru, une couleur  nos questions et une texture  nos histoires.\"},\"en\":{\"title\":\"Mazes\",\"prez\":\"En - I paint abstract shapes of labyrinths. By creating them, it is I who lose myself in these labyrinths. Finding the exit from the labyrinth means offering the spectator the harmony of forms and the dynamics of colors. Metaphorically, labyrinths are the unnecessary, ritualistic difficulties that we put into our daily lives to give value to what we accomplish. How long does it take to work on a subject for it to be serious? How should this cocktail be made so that it has the scent of luxury? How should I choose my clothes to look professional? All those things we do, losing ourselves in the withdrawal of our minds, hoping to give value to the path traveled, a color to our questions and a texture to our stories.\"}},\"illustrations\":{\"id\":\"illustrations\",\"fr\":{\"title\":\"Illustrations\",\"prez\":\"FR - Passion de jeu de rles et de jeu de socit, je prte mon savoir-faire artistique dans ce domaine. Vous trouverez sous cette section quelques-uns de mes travaux, professionnels et personnels.\",\"collections\":{\"cards\":\"FR- concept d\\'illustrations pour carte  jouer.\",\"landscapes\":\"FR- diffrents travaux de mise en scne et de paysages\",\"concepts\":\"FR- travaux d\\'ambiance et de concept pour l\\'industrie du jeu\",\"characters\":\"FR- travaux et recherches de personnages et objets pour l\\'dition.\",\"personal\":\"FR- travaux personnels, recherches et exprimentations.\"}},\"en\":{\"title\":\"Illustrations\",\"prez\":\"En - Passionate about role-playing games and board games, I use my skills in this field. You will find under this section some of my works, professional and personal.\",\"collections\":{\"cards\":\"EN- illustrations concept for game cards.\",\"landscapes\":\"EN- various works of staging and landscapes\",\"concepts\":\"EN- ambient and concept work for the gaming industry\",\"characters\":\"EN- work and research on characters and objects for publishing.\",\"personal\":\"EN- personal work, research and experimentation.\"}}}}');\n\n//# sourceURL=webpack://sitefolio/./src/utils/texts/texts.json?");

